  addScheduledReport(input: {
    isGroupReport: false,
    isOneTimeReport: true,
    domain: 134,
    reportType: 1,
    reportTemplate: 1,
    reportFilter: { filters: "[{"attribute":"period","type":"datetime","comparison":"between","value":"[\"2017-01-01\", \"2017-12-23\"]"},{"attribute":"domains","type":"list","comparison":"contains","value":"[2]"},{"attribute":"compare_to","type":"datetime","comparison":"eq","value":"2017-10-10"}]" }, schedule: 1, recipients: ["cm@accuranker.com"], sender: "cm-sender@accuranker.com", emailSubject: "subject", emailBody: "body", language: "da"}
